     */
    function updateGlobalMintLimit (uint _newMintLimit) external onlyOwner() {
        require(_newMintLimit > 0 && _newMintLimit != mintLimit, "Invalid mint limit");
        mintLimit = _newMintLimit;

        emit GlobalMintLimitUpdated(_newMintLimit);
    }

